import React from "react";
import "../stylesheets/Home.css";
import pizza from "../Images/pizza.jpg";


const Home = () => {
    return (
    <div className="body">
        <div className="content"></div>
        <h1>Welcome to React Meals!</h1>
        <h2>Serving Fresh and Delecious!</h2>
        <div>
            <img src={pizza} alt="" />
        </div>
    </div>);
};

export default Home;
